import React from "react";
import { Box, Text, Button } from "@chakra-ui/react";
import { useHistory } from "react-router-dom";

const history = useHistory();
function Dashboard() {
  const logoutHandler = () => {
    localStorage.removeItem("userInfo");
    history.push("/");
  };

  return (
    <div>
      <Box
        display="flex"
        justifyContent="flex-end"
        alignItems="flex-start"
        height="20vh"
        mb={0}
      >
        <Box
          display="flex"
          justifyContent="space-between"
          alignItems="center"
          bg="white"
          width="100%"
          padding="5px 10px"
          borderWidth="5px"
        >
          <Text
            fontSize="2xl"
            fontFamily="Work Sans"
            textAlign="center"
            width="100%"
          >
            Rewards
          </Text>
          <Button onClick={logoutHandler} colorScheme="teal" variant="ghost">
            Logout
          </Button>
        </Box>
      </Box>
    </div>
  );
}

export default Dashboard;
